import React from "react";

function Footer() {
  return (
    <nav className="flex border-2 border-rose-500">
      <h4 className="flex-auto">Home</h4>
      <h4 className="flex-auto">Search</h4>
      <h4 className="flex-auto">Login Page</h4>
    </nav>
  );
}

export default Footer;
